    return(
        <a href="#">
          <div className="card card--promo p-3 rounded-0 border-0 text-white" 
            style={{backgroundImage:'url(https://picsum.photos/id/26/1500/700)'}}>
              <div className="caption">
                <h1>PROMO PRIA</h1>
                <h2>Beli 1 dapat 2</h2>
                <p>Periode berakhir 2020</p>
              </div>
              <span className="layer"></span>
          </div>
        </a>
    )
}
